import { StyleSheet } from 'react-native'

const styles = StyleSheet.create({
  container: {
    padding: 5
  },
  scrollview: {
    marginBottom: 25
  },

  containerCard: {
    marginRight: 10,
    marginLeft: 10,
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'center',
    width: 160
  },
  imgCard: {
    borderRadius: 10,
    height: 65,
    width: 65
  },
  title: {
    fontSize: 21,
    fontFamily: 'Corbel',
    fontWeight: 'bold',
    color: '#05233A',
    padding: 5
  },
  text: {
    paddingTop: 5,
    paddingBottom: 5,
    paddingRight: 35,
    paddingLeft: 5,
    fontSize: 16,
    fontFamily: 'Corbel'
  },
  subtext: {
    padding: 5,
    fontSize: 14,
    fontFamily: 'Corbel'
  }
})

export default styles
